INSERT INTO `product` (`id`, `description`, `name`, `price`, `quantity`, `thumbnail`, `subcategory_id`) VALUES
	('20-series', 'GREAT FOR THE WHOLE FAMILY: Whether you\'re looking to surf, stream, or tackle that next big assignment, this PC has been designed to give everyone what they need\nRELIABLE PROCESSOR: Intel(R) Celeron(R) processor J4005\nINTEGRATED HD DISPLAY: 19.5" HD diagonal widescreen + TN WLED-backlit display (1600x900)\nGREAT STORAGE AND MEMORY: 1 TB hard drive + 4 GB SDRAM\nINTEL(R) UHD GRAPHICS 600: Smoothly stream content and play your favorite games\nMOUSE AND KEYBOARD: USB white wired keyboard with volume control and USB white wired optical mouse\nSTYLISH DESIGN: Ripple pattern and an elevated stand', '20 Series', 400, 2, 'https://images-na.ssl-images-amazon.com/images/I/814d1kZahGL._SL1500_.jpg', '15b5b767-4082-466d-9e8e-bdda821ede27'),
	('24-f0047c', 'PERFORMANCE: Powerful AMD A9 Dual Core processor and 8 GB of DDR4 SDRAM memory for high performance / Powered by Windows 10 Home\nSTORAGE: Plenty of storage space thanks to 1 TB hard drive; store and share media via DVD writer and 3-in-1 card reader\nDISPLAY: Gigantic 23.8" Full HD backlit touchscreen micro edge display plus AMD Radeon R5 GPU\nCONNECT: Connect using 802.11ac wireless and Bluetooth 4.2\nSOUND AND VIDEO: Front-facing HP HD privacy camera plus integrated audio with stereo speakers', '24-F0047C', 467, 3, 'https://images-na.ssl-images-amazon.com/images/I/612hIjqoI9L._SL1104_.jpg', '15b5b767-4082-466d-9e8e-bdda821ede27'),
	('4wj86ua', '8th Generation Intel Core i5 Quad-core Processor, up to 3.4 GHz with Intel Turbo Boost Technology, 6MB Cache\n17.3-inch diagonal HD+ SVA BrightView WLED-backlit Display (1600x900)\n8GB DDR4 SDRAM / 16 GB Intel Optane memory, 2TB, 2TB 5400 RPM Serial ATA hard drive\n802.11b/g/n/ac (2x2) Wi-Fi, DVD-Writer, Full-size island-style backlit keyboard with numeric keypad\nWindows 10 Home, 2-year Care Pack is included for extended protection beyond the standard limited warranty', '4WJ86UA', 591, 5, 'https://images-na.ssl-images-amazon.com/images/I/81TLd42hpLL._SL1500_.jpg', 'c834072c-3bb5-4644-a1bc-6736cf043c04'),
	('ath-m50x', 'As the most critically acclaimed model in the M-Series line, the ATH-M50 is praised by top audio engineers and pro audio reviewers year after year. Now, the ATH-M50x professional studio monitor headphones feature the same coveted sonic signature, with the added feature of detachable cables. From the large aperture drivers, sound isolating earcups and robust construction, the M50x provides an unmatched experience for the most critical audio professionals.', 'ATH-M50x', 148.49, 25, 'https://images-na.ssl-images-amazon.com/images/I/81Hajq6vPiL._SL1500_.jpg', 'c93b538a-fa4d-4b6e-889b-c54df57e2129'),
	('audio-technica-ath-msr7bk', 'Audio-Technica ATH-MSR7 SonicPro (Black) Over-Ear High-Resolution Audio Headphones Springing from Audio-Technica’s rich heritage in professional audio, the ATH-MSR7 Over-Ear High-Resolution Audio Headphones are designed to reproduce Hi-Res Audio, allowing users to hear music the way it was intended. The over-ear headphones are outfitted with exclusive 45 mm True Motion Drivers, which utilize lightweight voice coils, a custom-mounted printed circuit board and specially designed diaphragm to improve transient response and minimize sound distortion for rich, detailed audio reproduction. The ATH-MSR7 features multi-layered air damping technology for extended mid-to-low frequency response. The housings, designed to mirror the full shape of the ear, are constructed of an aluminum/magnesium mix, layered to provide a lightweight, rigid structure that reduces unwanted resonance. Three precisely placed vents within these layers work to control air flow and improve dynamics. A stainless steel acoustic mesh resistor provides improved high-frequency response, while a bass acoustic resistor delivers accurate low-frequency response. The headphones’ highly flexible swivel design - with soft, memory foam earpads and headband - ensure lasting comfort even during the longest listening sessions. And with three detachable cables, one with in-line controls and microphone for smartphones and other devices, the ATH-MSR7 provides Hi-Res Audio anywhere you go.', 'ATH-MSR7BK', 159.99, 34, 'https://images-na.ssl-images-amazon.com/images/I/61H8ss4RqZL._SL1000_.jpg', 'c93b538a-fa4d-4b6e-889b-c54df57e2129'),
	('bose-quietcomfort-35', ' How did Bose make its world-class noise cancelling headphones even better? It now allows you to adjust the level of noise cancellation on the new Quiet Comfort 35 wireless headphones II. All it takes is a push of the new Action button to take full advantage of the industry-leading noise cancelling technology and completely block out the world around you, or let in some noise around you. You choose the level that best suits your environment. So go ahead, lose yourself in your music-or the quiet. Of course, QC35 headphones II also deliver the same performance and technologies you expect from Bose: volume-optimized EQ so the sound is always true to your music no matter the volume and a noise-rejecting dual-mic system for clear calls, even in noisy environments. The built-in microphone also gives you easy access to your phone\'s default virtual assistant, like Siri. Just hold down the multi-function button and use the power of your voice to control your music and more. Plus, you\'ll be free from wires with Bluetooth and NFC pairing and voice prompts to walk you through every step of the process. Premium materials like super-soft Alcantara and synthetic protein leather make for a comfortable fit for listening all day long. And for even more functionality, download the Bose Connect app. It lets you personalize your headphones, share music between more than one pair of compatible Bose Bluetooth headphones, manage Bluetooth connections and access future software updates. You can even choose your level of noise cancellation directly within the app. Up to 20 hours of battery life from a rechargeable lithium-ion battery (and up to 40 hours in wired mode) let you keep the music playing all day-or flight, train ride, study session-long. Available in Black or Silver.', 'QuietComfort 35', 349, 10, 'https://images-na.ssl-images-amazon.com/images/I/61JPyEqYGQL._SL1000_.jpg', 'c93b538a-fa4d-4b6e-889b-c54df57e2129'),
	('dual-port-usb', '2-port 24-watt USB car charger plugs into a car’s DC adapter and can charge up to 2 devices at a time—great for phones, tablets, and other devices\nDevice detection allows for charging at the fastest speed possible—up to 2.4 amps per port or 4.8 amps total (does not support Qualcomm Quick Charge)\nCompatible with iPhone X, 8 Plus, 8, 7 Plus, 7, 6s Plus, 6s, 6 Plus, Galaxy S7, S6, Edge, Plus, iPad Pro, iPad Air, Air 2, iPad mini, LG, Nexus, HTC, and more\nBuilt-in safety system includes overload, short-circuit, and overvoltage protection (CE, FCC, and RoHS certified); lightweight and compact for easy portability\n12 / 24 volt input; discrete, non-distracting LED confirms connection; charging cable not included; backed by AmazonBasics limited 1-year warranty', 'Dual-Port USB', 8.99, 4, 'https://images-na.ssl-images-amazon.com/images/I/61-5JCvBQCL._SL1495_.jpg', '28cc3537-9c35-4aa4-9527-3e8541c3e054'),
	('fire-hd-8', '8" HD display; 16 or 32 GB of internal storage (up to 400 GB with microSD);\n1.3 GHz quad-core processor;\nUp to 10 hours of battery life;\nAlexa hands-free enabled;\n1.5 GB of RAM;\n2 MP front-facing camera + 2 MP rear-facing HD camera;\nDual-band Wi-Fi;\n90-day limited warranty;\nEnjoy millions of movies, TV episodes, songs, books, apps, and games;', 'Fire HD 8', 79.99, 5, 'https://images-na.ssl-images-amazon.com/images/I/61SJLQB134L._SL1000_.jpg', '630a273a-711b-4f2b-8444-718c20099c3c'),
	('fire-tv-stick-4k', 'The most powerful 4K streaming media stick with a Wi-Fi antenna design optimized for 4K Ultra HD streaming.\nLaunch and control content with the Alexa Voice Remote. Watch favorites from Netflix, Prime Video, Hulu, STARZ, SHOWTIME, or CBS All Access, plus stream for free with Pluto TV, IMDb Freedive, and others.\nEnjoy brilliant picture with access to 4K Ultra HD, Dolby Vision, HDR, and HDR10+. Experience immersive sound with Dolby Atmos on select Prime Video titles.\nChoose from 500,000 movies and TV episodes. Watch favorites from Netflix, Prime Video, Hulu, STARZ, SHOWTIME, CBS All Access, and others.\nFire TV Stick devices have more storage for apps and games than any other streaming media stick.\nExperience tens of thousands of channels, apps, and Alexa skills, plus millions of websites like YouTube, Facebook, and Reddit.\nAlexa on Fire TV provides the most comprehensive voice experience of any streaming media player—view live camera feeds, check the weather, dim the lights, and stream music.\nAmazon Prime members get unlimited access to thousands of movies and TV episodes, plus ad-free listening to millions of songs with Prime Music.', 'Fire TV Stick 4K', 49.99, 16, 'https://images-na.ssl-images-amazon.com/images/I/51CgKGfMelL._SL1000_.jpg', 'cdd8f8a8-4166-4812-b84a-06c0fc9aab3b'),
	('galaxy-a30', 'Unlocked cell phones are compatible with GSM carrier such as AT&T and T-Mobile, but are not compatible with CDMA carriers such as Verizon and Sprint.\nPlease check if your GSM cellular carrier supports the bands for this model before purchasing, LTE may not be available in all areas: GSM 850 / 900 / 1800 / 1900 - SIM 1 & SIM 2, HSDPA 850 / 900 / 1900 / 2100, LTE band 1(2100), 3(1800), 5(850), 7(2600), 8(900), 20(800), 38(2600), 40(2300), 41(2500).\nDual Sim Slot, Display: 16.21cm (6.4") FHD+ Super AMOLED Infinity-U, Camera: Rear 16MP (F1.7) + 5MP (F2.2) Front 16MP (F2.0), Memory: 4GB | 64GB Expandable up to 512GB, Processor: Exynos 7904 Octa-Core, OS: Android Pie Samsung One UI.\nThis device may not include a US warranty as some manufacturers do not honor warranties for international items. Please contact the seller for specific warranty information.\nThe box contains: Your new device, USB cable, Charger (May be Foreign), Documentation.', 'Galaxy A30', 256.99, 6, 'https://images-na.ssl-images-amazon.com/images/I/81EcudA5T0L._SL1500_.jpg', '251c2e9d-08d1-48aa-9267-85aeb3f88519'),
	('go-2-', 'The JBL GO 2 is a full-featured waterproof Bluetooth speaker to take with you everywhere. Wirelessly stream music via Bluetooth for up to 5 hours of continuous JBL quality sound. Making a splash with its new IPX7 waterproof design, GO 2 gives music lovers the opportunity to bring their speaker poolside, or to the beach. GO 2 also offers crystal clear phone call experience with its built-in noise-cancelling speakerphone. Crafted in a compact design with 12 eye-catching colors to choose from, GO 2 instantly raises your style profile to all-new levels.', 'Go 2 ', 29.9, 13, 'https://images-na.ssl-images-amazon.com/images/I/91JPrxbYLeL._SL1500_.jpg', '9328b2d6-f936-43f1-8362-08b382673e50'),
	('hd-598', 'The HD 598 Cs headphones are a closed back, over ear, audiophile grade headphone combining exceptional sound quality with extreme wearing comfort. This premium headphone Features a padded leatherette headband and luxurious velour covered ear pads perfect for long listening sessions. Ear coupling - Circumaural.', 'HD 598', 169.55, 27, 'https://images-na.ssl-images-amazon.com/images/I/81t4sgDlfhL._SL1500_.jpg', 'c93b538a-fa4d-4b6e-889b-c54df57e2129'),
	('headphones-sennheiser-hd-599', 'The best in class, remastered. The new HD 500 Series pushes performance to the next level. Topping the product line is the HD 599, a premium headphone for those seeking sophisticated sound, design and build quality. Powered by Sennheiser proprietary transducer technology and featuring the \'Ergonomic Acoustic Refinement\' (E.A.R) design, the HD 599 represents a step into the world of audiophile sound reproduction. This open back, around ear headphone delivers an impressively natural tonal balance with outstanding spatial performance. Exceptional wearing comfort is provided by large ear cups fitted with plush velour ear cushions. Premium design cues; timeless ivory color scheme, brown headband stitching and matte metallic detail, communicate quality at first glance. Crafted to impress, the HD 599 is a solid choice for music listeners with sense of discovery!', 'HD 599', 149.9, 20, 'https://images-na.ssl-images-amazon.com/images/I/61rC-yMhtZL._SX679_.jpg', 'c93b538a-fa4d-4b6e-889b-c54df57e2129'),
	('htp-074', 'The immersive HTP-074 package comes with a 5.1-channel AV receiver, 5 compact speakers and a subwoofer. Just connect your Blu-ray Disc player or DVD player and enjoy quality sound for your home entertainment.\nFeaturing 4 HDMI inputs and Ultra HD (4K/60p/4:4:4) pass-through with HDCP 2.2, the HTP-074 supports the latest video standards HDR. You can also enjoy audio streaming from compatible devices with the built-in Bluetooth Wireless Technology.', 'HTP-074', 349, 5, 'https://images-na.ssl-images-amazon.com/images/I/51IoReHinNL._SL1200_.jpg', 'fb6885b2-9f12-408b-a851-1fc995fa5df7'),
	('huawei-honor-8x', 'Full View Display with Nearly Borderless Design. Seamless HD full view screen, with advanced chip-on-film (COF) technology and special antenna design. Only 4. 25 mm width of bottom border, and incredible screen-to-body ratio of 91%. The display occupies nearly the entire front of the phone. 6. 5-inch and 1080P High Definition. With its nearly borderless design, the phone can retain the same body size as a 5. 5-inch phone, making for an easier grip. The 19. 5: 9 aspect ratio and enhanced visual quality show more details and offer a better cinematic experience. Glass Body with Visual Grating Effect. Second-generation anti-glare film, with two visual effects and 15 layers of rich reflective craftsmanship on the same glass back. On the left border: complex intertwined and grained texture. On the right border: classic, unique pattern effect of Honor flagship phones. GPU Turbo: High Performance Graphics Processing Efficiency. GPU Turbo boosts efficiency in graphics processing with full FPS and FPS stability for gaming, while still reducing power consumption. 20MP AI Camera, Performing More Than You Can Imagine. AI dual-camera captures pictures at resolutions up to 20MP. AI multi-scene recognition can identify 22 different categories of objects in images and 500 scenarios in real-time. AI beauty effect can adjust and retouch images based on area segmentation. 16MP Front Camera, Enabling High Quality Selfies. With an enhanced ISO and supports 4-in-1 light fusion and multi-frame image processing to create quality and beautified selfies with booked effects.', 'Honor 8X', 214, 15, 'https://images-na.ssl-images-amazon.com/images/I/81uuNY%2B2tZL._SL1500_.jpg', '251c2e9d-08d1-48aa-9267-85aeb3f88519'),
	('inspiron', '7th Generation Intel(R) Core(TM) i7-7700 processor (8MB Cache, up to 4.20 GHz) 16GB DDR4 2400MHz 128GB SSD+1TB GB 7.2k HDD NVIDIA(R) GeForce(TM) GTX 1050 with 2GB GDDR5 graphics memory.', 'Inspiron', 923.3, 17, 'https://images-na.ssl-images-amazon.com/images/I/51NpSS7aPIL._SL1000_.jpg', 'ea3da887-8d53-4e68-8fc1-1bc81f4eeb41'),
	('ipad', '9.7-inch Retina display\nA10 Fusion chip\nTouch ID fingerprint sensor\n8MP back camera and 1.2MP FaceTime HD front camera\nTwo speaker audio\n802.11ac Wi-Fi and LTE cellular data\nUp to 10 hours of battery life', 'iPad', 459, 2, 'https://images-na.ssl-images-amazon.com/images/I/713n2dvqMaL._SL1500_.jpg', 'eea5a0dd-7c40-4ba1-a543-3897a461ef72'),
	('iphone-xs', 'CARRIER - This phone is locked to Simple Mobile from Tracfone, which means this device can only be used on the Simple Mobile wireless network.\nPLANS - Simple Mobile offers a variety of coverage plans, including 30-Day Unlimited Talk, Text & Data. No activation fees, no credit checks, and no hassles on a nationwide lightning-fast network. For more information or plan options, please visit the Simple Mobile website.\nACTIVATION - You’ll receive a Simple Mobile SIM kit with this iPhone. Follow the instructions to get service activated with the Simple Mobile plan of your choice.\n5.8-inch Super Retina display (OLED) with HDR\nIP68 dust and water resistant (maximum depth of 2 meters up to 30 minutes)\n12MP dual cameras with dual OIS and 7MP TrueDepth front camera—Portrait mode, Portrait Lighting, Depth Control, and Smart HDR', 'iPhone XS', 829, 4, 'https://images-na.ssl-images-amazon.com/images/I/71R46ju5GzL._SL1500_.jpg', 'ffb34971-fc88-4fce-886b-411b6606cf93'),
	('note-8-', 'This Samsung Galaxy Note 8 N950U 64GB GSM Unlocked Smartphone is Certified Refurbished. It is 100% functional and in near perfect cosmetic condition with the possibility of a few light hair marks. It will NOT come in its original packaging but will include a certified cable and UL approved power adapter. Headsets, SIM card and manual are NOT included. This Samsung Galaxy Note 8 N950U 64GB GSM Unlocked Smartphone is fully functional with T-Mobile, AT&T and all other GSM networks. It will NOT work on Sprint, Verizon, Boost, Virgin Mobile or any other CDMA network.', 'Note 8 ', 398, 11, 'https://images-na.ssl-images-amazon.com/images/I/71wjfOWQhsL._SL1500_.jpg', '251c2e9d-08d1-48aa-9267-85aeb3f88519'),
	('paperwhite', 'The thinnest, lightest Kindle Paperwhite yet—with a flush-front design and 300 ppi glare-free display that reads like real paper even in bright sunlight.\nNow waterproof, so you’re free to read and relax at the beach, by the pool, or in the bath.\nEnjoy twice the storage with 8 GB. Or choose 32 GB to hold more magazines, comics, and audiobooks.\nNow with Audible. Pair with Bluetooth headphones or speakers to listen to your story.\nA single battery charge lasts weeks, not hours.\nThe built-in adjustable light lets you read indoors and outdoors, day and night.\nGet instant access to new releases and bestsellers, plus over a million titles at $2.99 or less.', 'Paperwhite', 129.99, 7, 'https://images-na.ssl-images-amazon.com/images/I/61eAq6gg-XL._SL1000_.jpg', 'b7dcb1b0-d9d2-4ada-ad05-50f5bc9b3291'),
	('qn65q70rafxza', '100% COLOR VOLUME WITH QUANTUM DOTS: Powered by Quantum dots, Samsung’s 4K QLED TV offers over a billion shades of brilliant color and 100% color volume for exceptional depth of detail that will draw you in to the picture\nDIRECT FULL ARRAY BACKLIGHT 4X: Concentrated zones of precision-controlled LEDs auto-adjust contrast between pure whites and ultra-deep blacks, revealing hidden details in even the darkest scenes\nQUANTUM PROCESSOR 4K: Intelligently powered processor instantly upscales content to 4K for sharp detail and refined color\nQUANTUM HDR 8X: 4K depth of detail with high dynamic range powered by HDR10+ delivers the lightest to darkest colors, scene by scene, for amazing picture realism\nSMART TV FEATURES: OneRemote to control all compatible devices, Bixby voice command, on-screen universal guide, SmartThings to control compatible home appliances and devices, smart speaker expandability with Alexa and Google Assistant compatibility, and more', 'QN65Q70RAFXZA', 1499, 20, 'https://images-na.ssl-images-amazon.com/images/I/91eWjdLgiJL._SL1500_.jpg', 'b7141846-1f64-422a-9896-4aa719c1d9fd'),
	('qn65q90rafxza-', 'Direct Full Array 16x: Concentrated zones of precision-controlled LEDs display ultra-deep blacks and pure whites\nQuantum Processor 4K: An intelligently powered Processor instantly upscale content for sharp detail and refined color\nUltra Viewing Angle: Engineered to reduce glare and enhance color, providing a vibrant picture no matter where you sit\nQuantum HDR 16x: Discover a new frontier of spectacular color and incredible detail, just as the director intended\n100% color volume with Quantum Dot: Over a billion shades of brilliant color—powered by Quantum dots—deliver our most realistic picture.Resolution:3,840 x 2,160', 'QN65Q90RAFXZA ', 2970, 10, 'https://images-na.ssl-images-amazon.com/images/I/71HK8caaMoL._SL1500_.jpg', 'b7141846-1f64-422a-9896-4aa719c1d9fd'),
	('quietcomfort-25', 'QuietComfort 25 headphones are engineered to sound better, be more comfortable and easier to take with you. Put them on, and suddenly everything changes. Your music is deep, powerful and balanced, and so quiet that every note sounds clearer. Even air travel becomes enjoyable, as engine roar gently fades away. No matter how noisy the world is, it’s just you and your music—or simply peace and quiet.', 'QuietComfort 25', 174, 26, 'https://images-na.ssl-images-amazon.com/images/I/7196VLfktNL._SL1500_.jpg', 'c93b538a-fa4d-4b6e-889b-c54df57e2129'),
	('soundlink-ii', 'Enjoy a better wireless experience with Bose sound link around-ear wireless headphones ii. Exclusive technology delivers deep, immersive sound at any volume, making them the best-sounding wireless headphones available. A dual microphone system rejects noise and wind so you\'ll be heard loud and clear. And enhanced side tone makes your voice sound more natural. Sound link wireless headphones use the latest Bluetooth technology so you can easily connect to your mobile devices with seamless audio/video sync and switch between two devices. For nfc-enabled devices, you can simply tap the right ear cup for quick pairing. A rechargeable lithium-ion battery lets you listen for up to 15 hours and gives you up to 2 hours of play time with a 15-minute charge. Effortless touch controls allow for simple command of your music and calls. And voice prompts give you information about battery life, device connection and caller id. Sound link wireless headphones are lighter and more comfortable than other comparable wireless headphones so you can enjoy them all day long. Wear them almost anywhere, and experience uncompromised wireless performance. Included: sound link around-ear headphones; detachable audio cable; carrying case.', 'SoundLink II', 229, 16, 'https://images-na.ssl-images-amazon.com/images/I/6188bLRU64L._SL1000_.jpg', 'c93b538a-fa4d-4b6e-889b-c54df57e2129'),
	('soundlink-micro', 'The Bose Sound Link Micro Bluetooth speaker delivers sound so good for a speaker its size, you’ll never leave it behind. Proprietary Bose technology produces loud, clear sound—even outdoors—thanks to its custom-mounted transducer and passive radiators. All from a speaker that’s at home in your hand. It’s also waterproof from the inside out, has a soft but rugged exterior and tear-resistant silicone strap, so it’s ready to take with you on all life’s adventures. Attach it to your backpack or cooler, and don’t worry if it falls on the sidewalk or in the sand. And if you drop it in the pool, just dry it off and keep playing. Enjoy up to six hours of play time with a rechargeable lithium-ion battery.', 'SoundLink Micro', 99, 12, 'https://images-na.ssl-images-amazon.com/images/I/71yqkmEkGzL._SL1500_.jpg', '9328b2d6-f936-43f1-8362-08b382673e50'),
	('un40nu7100fxza-', 'PurColor: Enjoy millions of shades of color, fine tuned to create an incredibly vibrant picture. Motion Rate 120: Smooth action on fast-moving content\nHDR: View stunning high dynamic range content with a TV designed to support HDR10+\nSlim Design: An elegant slim design for a modern look you’ll admire\nSmart TV: Access your streaming services all in one place using the Samsung Remote Control\nNote-compression of video content may cause picture distortions, especially in fast moving pictures from sports programs and action movies. If the signal reception is weak or poor, screen distortion may be visible but it is not a malfunction. Mobile phones used close to the tv within 3.2 feet may cause noise on analog and digital channels\nPlease note the differences between the UN40NU7100 and the UN40NU710D. NU7100: Dark gray stand color, 450 nits HDR sustained brightness, Mega Dynamic Contrast. NU710D: Charcoal black stand color, 430 nits HDR sustained brightness, Ultra Dynamic Contrast.', 'UN40NU7100FXZA ', 436, 5, 'https://images-na.ssl-images-amazon.com/images/I/A1I7u42J4uL._SL1500_.jpg', 'e7e7b5f0-d82d-44fd-8923-b3e30ecab66c'),
	('usb-type-c-', 'Connect USB Type-C enabled devices (MacBook, Chromebook Pixel, Galaxy Note 7, etc.) with standard USB Type-A enabled devices (laptops, hard drives, power banks, wall/car chargers, etc.)\nIdeal for charging and powering USB Type-C enabled devices, as well as syncing data, photos and music\nReversible design - easily insert the Type-C connector into any Type-C enabled device (does not matter which side is up)\nType-C port is half the width and one-third the height of a standard USB-A connector (slightly larger compared to Lightning or Micro-USB ports)\nUp to 480 Mbps data transfer speed; power output up to 5V, 3 Amp\nCertified by USB-IF to be compliant with USB 2.0 Standard; backed by an AmazonBasics 1-Year Limited Warranty', 'USB Type-C ', 7.64, 20, 'https://images-na.ssl-images-amazon.com/images/I/51P%2B1JNnpnL._SL1046_.jpg', '28cc3537-9c35-4aa4-9527-3e8541c3e054'),
	('z906', 'This powerful THX-certified speaker system makes it easy for you to turn any room into a home theater. Hear every tire squeal, footstep and rumble the way the studio intended - in 5.1 discreet channels of explosive, detailed surround sound.', 'Z906', 199.9, 20, 'https://images-na.ssl-images-amazon.com/images/I/81eR41G4ydL._SL1500_.jpg', 'fb6885b2-9f12-408b-a851-1fc995fa5df7');
